import React from 'react'
import { View, Text } from 'react-native'
import { SafeAreaView } from 'react-native-web'

export default function Router() {
    return (
        <SafeAreaView>

            <View>
                <Text>Router</Text>
            </View>
        </SafeAreaView>
    )
}
